"use strict";(self.webpackChunkdocusaurus_demo=self.webpackChunkdocusaurus_demo||[]).push([[9026],{4852:a=>{a.exports=JSON.parse('{"blogPosts":[{"id":"Amizade","metadata":{"permalink":"/TP3/blog/Amizade","source":"@site/blog/academico.md","title":"Amizade","description":"Qual o CEO que n\xe3o tem o seu bra\xe7o direito?","date":"2023-12-27T23:12:28.000Z","formattedDate":"December 27, 2023","tags":[{"label":"dono","permalink":"/TP3/blog/tags/dono"},{"label":"hist\xf3ria","permalink":"/TP3/blog/tags/historia"},{"label":"empresa","permalink":"/TP3/blog/tags/empresa"},{"label":"premio","permalink":"/TP3/blog/tags/premio"},{"label":"servi\xe7o","permalink":"/TP3/blog/tags/servico"}],"readingTime":0.95,"hasTruncateMarker":false,"authors":[{"name":"Luis Rordrigues","title":"Diretor Executivo","imageURL":"https://cdn.discordapp.com/attachments/1049372613945851975/1189646670443585696/Exe.png?ex=659eebcc&is=658c76cc&hm=a9f7770f5540db9d7ba3018304c47f085660241bb2b5ea51eb477283c24fce4e&","key":"luis"}],"frontMatter":{"sidebar_position":4,"slug":"Amizade","title":"Amizade","authors":["luis"],"tags":["dono","hist\xf3ria","empresa","premio","servi\xe7o"]},"nextItem":{"title":"CEO","permalink":"/TP3/blog/CEO"}},"content":"Qual o CEO que n\xe3o tem o seu bra\xe7o direito? <br />\\n O Diretor Executivo, Lu\xeds Rodrigues, tem uma amizade s\xf3lida com Jo\xe3o, esta que se desenvolveu nos anos de faculdade, onde compartilharam n\xe3o apenas a jornada acad\xeamica, mas tamb\xe9m sonhos empreendedores. Ao formarem-se, ambos decidiram unir for\xe7as e fundar uma empresa que refletisse os seus valores e paix\xf5es compartilhadas. \\n <br />\\n\\n Jo\xe3o assumiu a presid\xeancia, trazendo sua vis\xe3o estrat\xe9gica e habilidades de lideran\xe7a, enquanto Lu\xeds ocupou o cargo de diretor executivo, concentrando-se na implementa\xe7\xe3o eficiente das opera\xe7\xf5es. <br />\\n Essa parceria n\xe3o apenas fortaleceu a empresa, mas tamb\xe9m solidificou ainda mais a amizade entre eles. A combina\xe7\xe3o \xfanica de habilidades e confian\xe7a m\xfatua permitiu que a empresa prosperasse sob a lideran\xe7a conjunta de dois amigos que compartilham n\xe3o apenas uma hist\xf3ria acad\xeamica, mas uma vis\xe3o comum para o futuro da empresa que constru\xedram juntos. <br />\\n\\n![joaoluis](https://cdn.discordapp.com/attachments/1049372613945851975/1189642155443109958/CEOeExe.png?ex=659ee798&is=658c7298&hm=d330909ecc65899d7cb77c73d0c8e680fe8e8db19291bb80af9154ffd9ea20b0&)\\n\\n**\\"A oficina de Jo\xe3o n\xe3o \xe9 apenas um lugar para consertar carros. \xc9 um s\xedmbolo de dedica\xe7\xe3o, persist\xeancia e amizade. Ele n\xe3o apenas construiu uma oficina; ele construiu um lar para todos n\xf3s.\\"** - Luis Rodrigues\\n\\n<button onClick={() => alert(\'Obrigado pelo Like!\')}>Like!</button>"},{"id":"CEO","metadata":{"permalink":"/TP3/blog/CEO","source":"@site/blog/dono.md","title":"CEO","description":"Jo\xe3o Pedro: O Vision\xe1rio por Tr\xe1s da WINRAR","date":"2023-12-27T23:12:28.000Z","formattedDate":"December 27, 2023","tags":[{"label":"dono","permalink":"/TP3/blog/tags/dono"},{"label":"hist\xf3ria","permalink":"/TP3/blog/tags/historia"}],"readingTime":1.41,"hasTruncateMarker":false,"authors":[{"name":"Jo\xe3o Pedro","title":"CEO das Oficinas WINRAR","imageURL":"https://cdn.discordapp.com/attachments/1049372613945851975/1189642153136226314/CEO.png?ex=659ee797&is=658c7297&hm=13f074f9bf250f55fe8aa506a066e16c6267feede2ea72848dded30846dbd0fd&","key":"joao"}],"frontMatter":{"sidebar_position":1,"slug":"CEO","title":"CEO","authors":["joao"],"tags":["dono","hist\xf3ria"]},"prevItem":{"title":"Amizade","permalink":"/TP3/blog/Amizade"},"nextItem":{"title":"Hist\xf3ria da Empresa","permalink":"/TP3/blog/Hist\xf3ria da Empresa"}},"content":"## Jo\xe3o Pedro: O Vision\xe1rio por Tr\xe1s da WINRAR\\n![joao](https://cdn.discordapp.com/attachments/1049372613945851975/1189647128641941665/perfilCEO.png?ex=659eec3a&is=658c773a&hm=58e8fc9f1dbe41736803ab734555b47fd257ee7d802c311a0bad0678a4372e31&)\\n\\nJo\xe3o Pedro, o fundador e mente vision\xe1ria por tr\xe1s da WINRAR, nascido a 15 de Julho de 1980\\niniciou a sua jornada empreendedora em 2005 com uma vis\xe3o \xfanica para o setor automotivo. Ao longo dos anos, ele liderou a expans\xe3o da empresa, enfrentando desafios econ\xf4micos com criatividade e mantendo um compromisso inabal\xe1vel com a qualidade. \\n<br />\\n\\nEm 2007 com a sua primeira oficina inaugurada tudo mudou. Jo\xe3o foi conseguindo estabelecer clientes leais, o que gerou uma maior reputa\xe7\xe3o. \\nFinalmente em 2010 Jo\xe3o decidiu abrir mais 2 oficinas em pontos estrat\xe9gicos. Foi aqui que Jo\xe3o percebeu o impacto que estava a ter.\\nAtualmente, Jo\xe3o possui 9 oficinas, sendo a \xfaltima inaugurada ainda este ano (2023).\\n<br />\\n\\nJo\xe3o transformou a WINRAR em uma refer\xeancia regional e nacional, em servi\xe7os automotivos. A busca pela inova\xe7\xe3o, responsabilidade social e \\npaix\xe3o pelo mundo automotivo moldaram n\xe3o apenas a sua carreira, mas tamb\xe9m o sucesso duradouro da WINRAR.\\n<br />\\n\\nComo l\xedder, Jo\xe3o cultiva uma cultura empresarial baseada no respeito m\xfatuo, na valoriza\xe7\xe3o dos colaboradores e no est\xedmulo \xe0 criatividade.\\nSua vis\xe3o de longo prazo n\xe3o se limita apenas ao crescimento da WINRAR, mas tamb\xe9m \xe0 constru\xe7\xe3o de um legado sustent\xe1vel e socialmente respons\xe1vel.\\nO sucesso de Jo\xe3o Pedro como empreendedor n\xe3o \xe9 apenas uma hist\xf3ria de triunfo comercial, mas um testemunho, dedica\xe7\xe3o e um profundo amor pelo que faz.\\n\\n![UALG](https://cdn.discordapp.com/attachments/722820894342381688/1189694556267090051/Design_sem_nome_2.png?ex=659f1865&is=658ca365&hm=ffee5ff20251cfc7cdb7632b5fec488f6562977c2ac7848e74285a289b7dd462&)\\n\\n## Certifica\xe7\xf5es Acad\xe9micas\\n\\n+ Mestrado em Engenharia Mec\xe2nica:\\n\\n+ Mestrado em Tecnologia Automotiva:\\n\\n+ Mestrado em Sistemas de Controle e Diagn\xf3stico de Ve\xedculos\\n\\n+ Licenciatura Gest\xe3o da Ind\xfastria Automotiva\\n\\n+ Licenciatura de Engenharia de Energias Renov\xe1veis para Transportes\\n\\n<button onClick={() => alert(\'Obrigado pelo Like!\')}>Like!</button>"},{"id":"Hist\xf3ria da Empresa","metadata":{"permalink":"/TP3/blog/Hist\xf3ria da Empresa","source":"@site/blog/historia.md","title":"Hist\xf3ria da Empresa","description":"Cap\xedtulo 1: A Funda\xe7\xe3o (2005)","date":"2023-12-27T23:12:28.000Z","formattedDate":"December 27, 2023","tags":[{"label":"dono","permalink":"/TP3/blog/tags/dono"},{"label":"hist\xf3ria","permalink":"/TP3/blog/tags/historia"},{"label":"empresa","permalink":"/TP3/blog/tags/empresa"}],"readingTime":1.865,"hasTruncateMarker":false,"authors":[{"name":"Jo\xe3o Pedro","title":"CEO das Oficinas WINRAR","imageURL":"https://cdn.discordapp.com/attachments/1049372613945851975/1189642153136226314/CEO.png?ex=659ee797&is=658c7297&hm=13f074f9bf250f55fe8aa506a066e16c6267feede2ea72848dded30846dbd0fd&","key":"joao"}],"frontMatter":{"sidebar_position":2,"slug":"Hist\xf3ria da Empresa","title":"Hist\xf3ria da Empresa","authors":["joao"],"tags":["dono","hist\xf3ria","empresa"]},"prevItem":{"title":"CEO","permalink":"/TP3/blog/CEO"},"nextItem":{"title":"Pr\xeamio 2023","permalink":"/TP3/blog/Pr\xeamio 2023"}},"content":"### Cap\xedtulo 1: A Funda\xe7\xe3o (2005)\\nNo ano de 2005, um vision\xe1rio empreendedor chamado Ricardo Silva funda a WINRAR, uma empresa dedicada \xe0 manuten\xe7\xe3o e reparo de ve\xedculos. A escolha do nome \xe9 uma homenagem ao popular software de compress\xe3o, refletindo a vis\xe3o da empresa de \\"compactar\\" os problemas dos clientes.\\n\\n### Cap\xedtulo 2: A Primeira Oficina (2007)\\nDois anos ap\xf3s sua cria\xe7\xe3o, a WINRAR inaugura sua primeira oficina na periferia da cidade. A equipe inicial \xe9 pequena, mas a qualidade do servi\xe7o e a aten\xe7\xe3o aos clientes come\xe7am a atrair uma clientela leal.\\n\\n### Cap\xedtulo 3: Expans\xe3o Urbana (2010)\\nCom a crescente demanda e a reputa\xe7\xe3o positiva, a WINRAR abre mais duas oficinas em \xe1reas estrat\xe9gicas da cidade. A empresa se destaca pela transpar\xeancia, pre\xe7os justos e profissionais altamente treinados.\\n\\n![oficina1](https://cdn.discordapp.com/attachments/722820894342381688/1189696812064448522/local.png?ex=659f1a7f&is=658ca57f&hm=aca879787b88fe4b1559181f57d53ac67b1cac5c43cd553433e1c272f73454b5&)\\n\\n### Cap\xedtulo 4: Inova\xe7\xe3o Tecnol\xf3gica (2013)\\nA WINRAR investe em tecnologia de ponta para diagn\xf3sticos r\xe1pidos e precisos. A introdu\xe7\xe3o de softwares avan\xe7ados e equipamentos de \xfaltima gera\xe7\xe3o coloca a empresa na vanguarda da ind\xfastria automotiva.\\n\\n### Cap\xedtulo 5: Desafios Econ\xf4micos (2016)\\nEm meio a desafios econ\xf4micos, a WINRAR enfrenta uma recess\xe3o, mas mant\xe9m sua filosofia de qualidade. A empresa utiliza estrat\xe9gias criativas de marketing e programas de fidelidade para superar a crise.\\n\\n### Cap\xedtulo 6: Diversifica\xe7\xe3o (2018)\\nReconhecendo a import\xe2ncia da diversifica\xe7\xe3o, a WINRAR amplia seus servi\xe7os para incluir personaliza\xe7\xe3o de ve\xedculos e venda de pe\xe7as. A empresa agora se posiciona como um centro automotivo completo.\\n\\n![automotivo](https://cdn.discordapp.com/attachments/722820894342381688/1189698573697302679/automotivo.png?ex=659f1c23&is=658ca723&hm=263ddfe3723fa94d905f4897eaeaf351cd8037a1fdc19fd7a7d95beb3cb822f4&)\\n\\n### Cap\xedtulo 7: Expans\xe3o Regional (2020)\\nCom a consolida\xe7\xe3o no mercado local, a WINRAR decide expandir-se regionalmente. Abre novas oficinas em cidades pr\xf3ximas, mantendo a mesma filosofia que a tornou bem-sucedida.\\n\\n### Cap\xedtulo 8: Sustentabilidade e Responsabilidade Social (2022)\\nA WINRAR adota pr\xe1ticas sustent\xe1veis e envolve-se em projetos de responsabilidade social, ganhando a admira\xe7\xe3o da comunidade. A empresa se torna um exemplo de como neg\xf3cios podem prosperar enquanto contribuem para o bem-estar social e ambiental.\\n\\n### Cap\xedtulo 9: A Rede Nacional (2023)\\nO sonho inicial de Ricardo Silva atinge seu auge quando a WINRAR estabelece sua presen\xe7a em todo o pa\xeds. Com nove oficinas estrategicamente distribu\xeddas, a empresa se torna uma refer\xeancia nacional em servi\xe7os automotivos, mantendo a qualidade que a tornou famosa desde o in\xedcio.\\n\\n![nacional](https://cdn.discordapp.com/attachments/722820894342381688/1189700611382448188/nacional1.png?ex=659f1e09&is=658ca909&hm=39f4af7195d4fa15e9724bed8d1d644cee4eae9f4aa04376161fe807a5fa0c49&)\\n\\n\\n<button onClick={() => alert(\'Obrigado pelo Like!\')}>Like!</button>"},{"id":"Pr\xeamio 2023","metadata":{"permalink":"/TP3/blog/Pr\xeamio 2023","source":"@site/blog/trofeu.md","title":"Pr\xeamio 2023","description":"Oficina WINRAR Recebe Prestigioso Pr\xeamio de Excel\xeancia em Servi\xe7os Automotivos","date":"2023-12-27T23:12:28.000Z","formattedDate":"December 27, 2023","tags":[{"label":"dono","permalink":"/TP3/blog/tags/dono"},{"label":"hist\xf3ria","permalink":"/TP3/blog/tags/historia"},{"label":"empresa","permalink":"/TP3/blog/tags/empresa"},{"label":"premio","permalink":"/TP3/blog/tags/premio"},{"label":"servi\xe7o","permalink":"/TP3/blog/tags/servico"}],"readingTime":0.495,"hasTruncateMarker":false,"authors":[{"name":"Jo\xe3o Pedro","title":"CEO das Oficinas WINRAR","imageURL":"https://cdn.discordapp.com/attachments/1049372613945851975/1189642153136226314/CEO.png?ex=659ee797&is=658c7297&hm=13f074f9bf250f55fe8aa506a066e16c6267feede2ea72848dded30846dbd0fd&","key":"joao"},{"name":"Luis Rordrigues","title":"Diretor Executivo","imageURL":"https://cdn.discordapp.com/attachments/1049372613945851975/1189646670443585696/Exe.png?ex=659eebcc&is=658c76cc&hm=a9f7770f5540db9d7ba3018304c47f085660241bb2b5ea51eb477283c24fce4e&","key":"luis"}],"frontMatter":{"sidebar_position":3,"slug":"Pr\xeamio 2023","title":"Pr\xeamio 2023","authors":["joao","luis"],"tags":["dono","hist\xf3ria","empresa","premio","pr\xeamio","servi\xe7o"]},"prevItem":{"title":"Hist\xf3ria da Empresa","permalink":"/TP3/blog/Hist\xf3ria da Empresa"}},"content":"### Oficina WINRAR Recebe Prestigioso Pr\xeamio de Excel\xeancia em Servi\xe7os Automotivos\\n\\nVila Automotiva, 26 de Fevereiro de 2023\\nNa \xfaltima sexta-feira, a Oficina WINRAR, dirigida pelo dedicado mec\xe2nico Jo\xe3o Silva, foi agraciada com o prestigioso Pr\xeamio de Excel\xeancia em Servi\xe7os Automotivos, reconhecendo a oficina como um padr\xe3o de qualidade e atendimento exemplar na comunidade local.\\n\\nO pr\xeamio, concedido pela Associa\xe7\xe3o Nacional de Mec\xe2nicos e Oficinas (ANMO), destaca a not\xe1vel contribui\xe7\xe3o da Oficina WINRAR para a ind\xfastria automotiva, reconhecendo sua abordagem excepcional em termos de servi\xe7os mec\xe2nicos, atendimento ao cliente e inova\xe7\xe3o tecnol\xf3gica.\\n\\n![PREMIO](https://cdn.discordapp.com/attachments/722820894342381688/1189703123049123910/PREMIO.png?ex=659f2060&is=658cab60&hm=378bbd1097cf6fd7f7dfb5fcecdbd08a91cf031a3c6b9dcdeadf7f01d1ad4c0b&)\\n\\n<button onClick={() => alert(\'Obrigado pelo Like!\')}>Like!</button>"}]}')}}]);